webpackJsonp([54],{"./node_modules/json-loader/index.js!./.cache/json/community-roadmap.json":function(e,t){e.exports={data:{allFile:{edges:[{node:{relativePath:"community/articles-and-videos.md",childMarkdownRemark:{frontmatter:{title:"Articles & Videos",order:10}}}},{node:{relativePath:"community/blog.md",childMarkdownRemark:{frontmatter:{title:"Blog",order:0}}}},{node:{relativePath:"community/companies.md",childMarkdownRemark:{frontmatter:{title:"Companies",order:60}}}},{node:{relativePath:"community/events.md",childMarkdownRemark:{frontmatter:{title:"Events",order:30}}}},{node:{relativePath:"community/roadmap.md",childMarkdownRemark:{frontmatter:{title:"Roadmap & Contribution",order:50}}}},{node:{relativePath:"community/examples.md",childMarkdownRemark:{frontmatter:{title:"Examples",order:20}}}},{node:{relativePath:"community/faq.md",childMarkdownRemark:{frontmatter:{title:"Frequently Asked Questions",order:40}}}},{node:{relativePath:"community/index.md",childMarkdownRemark:{frontmatter:{title:"Community",order:0}}}}]},file:{relativePath:"community/roadmap.md",childMarkdownRemark:{html:'<h3 id="reason-team-todos"><a href="#reason-team-todos" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Reason Team TODOs</h3>\n<p>Here\'s the place to keep up with what\'s happening for the Reason team! This list isn\'t exhaustive and might change.</p>\n<h4 id="near-future"><a href="#near-future" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Near future</h4>\n<ul>\n<li>Validating another secret ReasonReact feature, then release it</li>\n<li>Syntax change: JavaScript-style function calls <a href="https://github.com/facebook/reason/pull/1299">pull request</a></li>\n<li>Testing data structures <a href="https://github.com/facebookincubator/immutable-re">immutable.re</a></li>\n<li>Native compilation in bucklescript\'s <code>bsb</code> (see <a href="https://github.com/bsansouci/bsb-native">this fork</a>)</li>\n</ul>\n<h4 id="future"><a href="#future" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Future</h4>\n<ul>\n<li>Better async story</li>\n<li>Better dev-time printing facility</li>\n<li>Better JSON facilities</li>\n<li>Sleep more</li>\n</ul>\n<h3 id="your-contribution-opportunities"><a href="#your-contribution-opportunities" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Your Contribution Opportunities</h3>\n<p>Wanna help?</p>\n<ul>\n<li><a href="https://github.com/reasonml/reasonml.github.io/issues">Improve the documentation and website</a>. There\'s also the <a href="https://bucklescript.github.io/bucklescript/Manual.html#_contributing_to_the_documentation">BuckleScript manual and API reference</a></li>\n<li><a href="https://github.com/reasonml/reasonml.github.io/issues/3">Help us translate the docs!</a></li>\n<li><a href="https://github.com/reasonml-community/error-message-improvement/issues">Suggest better error messages</a></li>\n<li>Contribute to <a href="/guide/editor-tools/editors-plugins#officially-supported-editors">your favorite editor plugin for Reason</a></li>\n<li>On that note: better <a href="https://github.com/freebroccolo/ocaml-language-server">ocaml-language-server</a>. This will potentially power all our editor integration in the future.</li>\n<li>Come up with more <a href="https://github.com/reasonml/ideas-for-project-names-starting-with-re">project names starting with "re"</a></li>\n<li>Make bindings! Lots and lots of bindings! Have a look at the <a href="https://github.com/reasonml-community/index">reasonml-community index</a>, see if there\'s something missing or unfinished, then just get your hands dirty! Most of them could also use better documentation, not just more code.</li>\n<li>Whatever project you\'d normally do in JavaScript, try it in Reason + BuckleScript!</li>\n<li>Talk about Reason and BuckleScript!</li>\n<li>Ping @chenglou in <a href="https://discord.gg/reasonml">Discord</a> for more tasks.</li>\n</ul>',frontmatter:{title:"Roadmap & Contribution"}}}},pathContext:{section:"community",sectionTitle:"Community",relativePath:"community/roadmap.md",relatedFiles:"/^community\\/.*\\.md$/"}}}});
